    "Error getting task history for problem '<%= problem_id %>' and student '<%= student_id %>'. Make sure that the problem and student identifiers are complete and correct.": "\u00c9rr\u00f6r g\u00e9tt\u00efng t\u00e4sk h\u00efst\u00f6r\u00fd f\u00f6r pr\u00f6\u00dfl\u00e9m '<%= problem_id %>' \u00e4nd st\u00fcd\u00e9nt '<%= student_id %>'. M\u00e4k\u00e9 s\u00fcr\u00e9 th\u00e4t th\u00e9 pr\u00f6\u00dfl\u00e9m \u00e4nd st\u00fcd\u00e9nt \u00efd\u00e9nt\u00eff\u00ef\u00e9rs \u00e4r\u00e9 \u00e7\u00f6mpl\u00e9t\u00e9 \u00e4nd \u00e7\u00f6rr\u00e9\u00e7t. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f \u03b1\u2202\u03b9#", 
    "Error importing course": "\u00c9rr\u00f6r \u00efmp\u00f6rt\u00efng \u00e7\u00f6\u00fcrs\u00e9 \u2c60'\u03c3\u044f\u0454#", 
    "Error listing task history for this student and problem.": "\u00c9rr\u00f6r l\u00efst\u00efng t\u00e4sk h\u00efst\u00f6r\u00fd f\u00f6r th\u00efs st\u00fcd\u00e9nt \u00e4nd pr\u00f6\u00dfl\u00e9m. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142#", 
