    "Error starting a task to reset attempts for all students on problem '<%= problem_id %>'. Make sure that the problem identifier is complete and correct.": "\u00c9rr\u00f6r st\u00e4rt\u00efng \u00e4 t\u00e4sk t\u00f6 r\u00e9s\u00e9t \u00e4tt\u00e9mpts f\u00f6r \u00e4ll st\u00fcd\u00e9nts \u00f6n pr\u00f6\u00dfl\u00e9m '<%= problem_id %>'. M\u00e4k\u00e9 s\u00fcr\u00e9 th\u00e4t th\u00e9 pr\u00f6\u00dfl\u00e9m \u00efd\u00e9nt\u00eff\u00ef\u00e9r \u00efs \u00e7\u00f6mpl\u00e9t\u00e9 \u00e4nd \u00e7\u00f6rr\u00e9\u00e7t. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f \u03b1\u2202#", 
    "Error.": "\u00c9rr\u00f6r. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455#", 
    "Error:": "\u00c9rr\u00f6r: \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455#", 
    "Error: User '<%= username %>' has not yet activated their account. Users must create and activate their accounts before they can be assigned a role.": "\u00c9rr\u00f6r: \u00dbs\u00e9r '<%= username %>' h\u00e4s n\u00f6t \u00fd\u00e9t \u00e4\u00e7t\u00efv\u00e4t\u00e9d th\u00e9\u00efr \u00e4\u00e7\u00e7\u00f6\u00fcnt. \u00dbs\u00e9rs m\u00fcst \u00e7r\u00e9\u00e4t\u00e9 \u00e4nd \u00e4\u00e7t\u00efv\u00e4t\u00e9 th\u00e9\u00efr \u00e4\u00e7\u00e7\u00f6\u00fcnts \u00df\u00e9f\u00f6r\u00e9 th\u00e9\u00fd \u00e7\u00e4n \u00df\u00e9 \u00e4ss\u00efgn\u00e9d \u00e4 r\u00f6l\u00e9. \u2c60'\u03c3\u044f\u0454\u043c \u03b9\u03c1\u0455\u03c5\u043c \u2202\u03c3\u0142\u03c3\u044f \u0455\u03b9\u0442 \u03b1\u043c\u0454\u0442, \u00a2\u03c3\u03b7\u0455\u0454\u00a2\u0442\u0454\u0442\u03c5\u044f \u03b1#", 
