    "Expand Instructions": "\u00c9xp\u00e4nd \u00ccnstr\u00fc\u00e7t\u00ef\u00f6ns \u2c60'\u03c3\u044f#", 
    "Explicitly Hiding from Students": "\u00c9xpl\u00ef\u00e7\u00eftl\u00fd H\u00efd\u00efng fr\u00f6m St\u00fcd\u00e9nts \u2c60'\u03c3\u044f\u0454\u043c \u03b9#", 
